import React from "react";
import Slider from '@mui/material/Slider';

const TuningPanel = ({ onUserChangeTuningData, TuningData }) => {
    return (
        <div>
            <Slider
                disabled={false}
                marks={false}
                step={0.1}
                max={10}
                min={1}
                size="small"
                valueLabelDisplay="on"
                onChange={(e) => {
                    console.log(e.value)
                }}
            />
        </div>
    )
}

export default TuningPanel;
